import React from "react";

import "./NavTabs.css"

function NavTabs() {

    return (
        <nav className="navbar navbar-expand-lg navbar-dark fixed-top ">
            <a className="navbar-brand" href="/"><h2>Google Books</h2></a>


            <ul>

                <li className="nav-item" id="se"><a href="/"><h2>Search</h2></a></li>



                <li className="nav-item" id="saved"><a href="/saved"><h2>Saved</h2></a></li>


            </ul>

        </nav>

    )

}

export default NavTabs;
